import React from 'react';
import './App.css';

import { BrowserRouter as Router, useRoutes } from "react-router-dom";
import About from './components/pages/About';

function App() {
  const routes = useRoutes([
    {path: "/", element: <About />}
  ])
  return (
    <div className="App">
      {routes}
    </div>
  );
}

const AppWrapper = () => {
  return (
    <Router>
      <App />
    </Router>  
  )
}

export default AppWrapper;
